// SPDX-License-Identifier: MIT
pragma solidity >=0.6.12 <0.9.0;

contract Staking {
    address public owner;
    uint public stakingPeriod;
    uint public totalRewards;
    mapping(address => uint) public userBalances;
    mapping(address => uint) public stakedBalances;
    mapping(address => uint) public stakingStartTimes;

    constructor(uint _stakingPeriod, uint _totalRewards) {
        owner = msg.sender;
        stakingPeriod = _stakingPeriod;
        totalRewards = _totalRewards;
    }

    function stake(uint _amount) public {
        // Check if user has sufficient balance
        require(userBalances[msg.sender] >= _amount, "Insufficient balance");

        // Deduct staking amount from user's balance
        userBalances[msg.sender] -= _amount;

        // Add staking amount to user's staked balance
        stakedBalances[msg.sender] += _amount;

        // Set staking start time for the user
        stakingStartTimes[msg.sender] = block.timestamp;
    }

    function calculateRewards(address _user) public view returns (uint) {
        // Calculate time staked in seconds
        uint timeStaked = block.timestamp - stakingStartTimes[_user];

        // Calculate rewards using the formula
        uint rewards = (stakedBalances[_user] * timeStaked) / stakingPeriod;

        return rewards;
    }

    function distributeRewards() public {
        address[] memory stakersList = getStakers(); // Assuming you have a function to get stakers' addresses

        // Iterate over all stakers and distribute rewards
        for (uint i = 0; i < stakersList.length; i++) {
            address staker = stakersList[i];

            // Calculate rewards for the current staker
            uint rewards = calculateRewards(staker);

            // Add rewards to the staker's balance
            userBalances[staker] += rewards;

            // Reset staking information for the staker
            stakedBalances[staker] = 0;
            stakingStartTimes[staker] = 0;
        }
    }

    function getStakers() public view returns (address[] memory) {
        // Logic to return the array of staker addresses
        // You can implement this function to return stakers' addresses based on your storage mechanism.
        // For example, you might store stakers in an array and return that array here.
    }

    function withdraw() public {
        // Calculate user's total balance, including staked amount and rewards
        uint totalBalance = userBalances[msg.sender] + calculateRewards(msg.sender);

        // Check if user has sufficient balance to withdraw
        require(totalBalance > 0, "Insufficient balance to withdraw");

        // Convert msg.sender to address payable using typecast
        address payable recipient = payable(msg.sender);

        // Transfer total balance to user's address
        recipient.transfer(totalBalance);

        // Reset staked balance and staking start time
        stakedBalances[msg.sender] = 0;
        stakingStartTimes[msg.sender] = 0;

        // Remove user from mappings if balance is zero
        if (userBalances[msg.sender] == 0) {
            delete userBalances[msg.sender];
        }
    }
}

